import * as utils from './DrawUtils'
import AppParams from './AppParams'
import Connection from './Connection'
import Finger from './Finger'
import Port from './Port'
import Arc from './Arc'
import Circle from './Circle'


const patchbayDefaults = {
  tempThickness: 0.1,
  screenPercentage: 0.25
};

class Patchbay {
  constructor (context) {
    this.params = AppParams(context);
    this.params.inCircle = Circle(
      this.params.inType,
      patchbayDefaults.screenPercentage,
      patchbayDefaults.tempThickness
    );
    this.params.outCircle = Circle(
      this.params.outType,
      patchbayDefaults.screenPercentage,
      patchbayDefaults.tempThickness
    );
    this.finger = Finger(this.params);
  }

  hello () {
    console.log('Patchbay Here!');
  }
}
